import React from 'react'
import { Link, useNavigate } from 'react-router-dom'
import {useState} from 'react';
import Validation from './SignUpValidation'; 
import axios from 'axios';

function SignUp() {
    const [values, setValues] = useState({
        name: '',
        email: '',
        password: ''
    })
    const navigate = useNavigate();
    const [errors, setErrors] = useState({})
    const handleInput = (event) => {
        setValues(prev => ({...prev, [event.target.name]: [event.target.value]}))
    }
    const handleSubmit = (event) => {
        event.preventDefault();
        setErrors(Validation(values));
        if(errors.correo_electronico === "" && errors.nombre === "" && errors.apellidos === "" && errors.fecha_nacimiento === "" && errors.contrasenna === "") {
            axios.post('http://localhost:9000/signup', values)
            .then(res => {
                navigate('/');
            } )
            .catch (res => console.log("err"));
        }
    }

  return (
    <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
    <div className='bg-white p-3 rounded w-25'>
        <h2>Regístrarse</h2>
        <form action='' onSubmit={handleSubmit}>
            <div className='mb-3'>
                <label htmlFor='name'>Nombre</label>
                <input type='text' placeholder='Ingrese su nombre' name='name' onChange={handleInput} className='form-control rounded-0'></input>
                {errors.name && <span className='text-danger'>{errors.name}</span>}
            </div>
            <div className='mb-3'>
                <label htmlFor='name'>Apellidos</label>
                <input type='text' placeholder='Ingrese sus apellidos' name='name' onChange={handleInput} className='form-control rounded-0'></input>
                {errors.name && <span className='text-danger'>{errors.name}</span>}
            </div>
            <div className='mb-3'>
                <label htmlFor='name'>Correo electronico</label>
                <input type='text' placeholder='Ingrese su correo' name='name' onChange={handleInput} className='form-control rounded-0'></input>
                {errors.name && <span className='text-danger'>{errors.name}</span>}
            </div>
            <div className='mb-3'>
                <label htmlFor='fecha_nacimiento'>Fecha de nacimiento</label>
                <input type='date' placeholder='Ingrese su fecha de nacimiento' name='fecha_nacimiento' onChange={handleInput} className='form-control rounded-0'></input>
                {errors.fecha_nacimiento && <span className='text-danger'>{errors.fecha_nacimiento}</span>}
            </div>
            <div className='mb-3'>
                <label htmlFor='contrasenna'>Contraseña</label>
                <input type='password' placeholder='Cree una contraseña' name='contrasenna' onChange={handleInput} className='form-control rounded-0'></input>
                {errors.contrasenna && <span className='text-danger'>{errors.contrasenna}</span>}
            </div>
            <button type='submit' className='btn btn-success w-100'>Regístrarse</button>
            <p>Aceptar términos y condiciones</p>
            <Link to = '/' className='btn btn-default border w-100 text-decoration-none'>¿No tienes una cuenta?</Link>
        </form>
    </div>   
</div>
  )
}

export default SignUp
